css:
atom-text-editor /deep/ ::-webkit-scrollbar,
.tree-view-resizer /deep/ ::-webkit-scrollbar {
  width: 4px !important;
  height: 4px !important;
}
atom-text-editor /deep/ ::-webkit-scrollbar-thumb,
.tree-view-resizer /deep/ ::-webkit-scrollbar-thumb {
  background: #4d4d4d !important;
}
.tree-view {
  background-color: #272b35;
}
.tree-view .entry.list-item:hover:before {
  content: '';
  background-color: rgba(52, 61, 70, 0.5);
  position: absolute;
  left: 0;
  right: 0;
  height: 25px;
}
.tree-view .entry.list-item:hover span {
  color: #c0c5ce;
}
atom-pane .tab-bar {
  height: 50px;
}
atom-pane .tab-bar .tab {
  height: 50px;
  line-height: 50px;
}
atom-pane .tab-bar .tab.modified:not(:hover) .close-icon {
  top: 23px;
}
atom-pane .tab-bar .tab:first-child {
  margin-left: 8px;
}
atom-pane .tab-bar .tab.active {
  line-height: 48px;
  height: 50px;
}
atom-pane .tab-bar .tab.active .close-icon {
  line-height: 50px;
}
atom-pane .tab-bar .tab.active:before {
  height: 50px;
}
atom-panel.bottom.panel-bottom {
  background-color: #272b35;
}
atom-panel.bottom.panel-bottom a,
atom-panel.bottom.panel-bottom .branch-label,
atom-panel.bottom.panel-bottom div:not(.package-updates-status-view):not(.deprecation-cop-status) {
  color: #a7adba;
}
atom-panel.overlay {
  padding: 0;
}
atom-panel.overlay atom-text-editor[mini] {
  background-color: #1c1f26;
  margin-bottom: 0;
  height: 45px;
  padding: 10px;
  max-height: none;
}
atom-panel.overlay ol.list-group {
  margin: 0;
  line-height: 50px;
}
atom-panel.overlay ol.list-group li {
  padding: 5px 20px;
}
